import React from "react";
import classes from '../css/input.css';
const input = ({searchFunction}) =>{

    return(
        <input placeholder="Type to find..." className={classes.MyInput} onChange={(e)=> searchFunction(e.target.value)}>
        </input>
    )
}
export default input;
